import React, { Component } from "react";

class SearchBar extends Component {
  render() {
    return (
      <div className="search-bar">
        <input
          type="search"
          name="search"
          className="form-control mb-3"
          id=""
        />
      </div>
    );
  }
}

export default SearchBar;
